import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import Jumbotron from './allComponents/jumbotron'

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Jumbotron/>
        <p>
          This will soon be EUG
        </p>
        <a
          className="App-link"
          href="http://evogrows.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn about EUG
        </a>
      </header>
    </div>
  );
}

export default App;
